window.gfUtils = window.gfUtils || {};
window.gfUtils.live2dUtils = {};

window.gfUtils.live2dUtils.createLive2dSprite = function(model) {
  // Live 2D Sprite
  var l2d_tdoll_sprite = new PIXI.Live2DSprite(model, {
    debugLog: false,
    randomMotion: false,
    eyeBlink: true
  });
  
  l2d_tdoll_sprite.startRandomMotion('idle');

  var movehandler = function(evt) {
    const point = evt.data.global;
    l2d_tdoll_sprite.setViewPoint(point.x, point.y);
  };
  l2d_tdoll_sprite.on('mousemove', movehandler );
  
  var clickhandler = function(evt) {
    const point = evt.data.global;
    if (l2d_tdoll_sprite.hitTest('body', point.x, point.y)) {
      l2d_tdoll_sprite.startRandomMotionOnce('tap_figure');
      // Info: Maybe add individual hit tests?
    } else {
      l2d_tdoll_sprite.startRandomMotionOnce('tap_figure');
    }
  };
  l2d_tdoll_sprite.on('click', clickhandler);
  
  return l2d_tdoll_sprite;
};

window.gfUtils.live2dUtils.makeBase64Request = function makeBase64Request(url) {
  var xhr = new XMLHttpRequest();
  var prom = new Promise(function (resolve, reject) {
    xhr.open('GET', url, true);
    xhr.responseType = 'arraybuffer';
    xhr.onload = function () {
      if (this.status >= 200 && this.status < 300) {
        resolve(window.gfUtils.base64ArrayBuffer(xhr.response));
      } else {
        console.log("this.status not ok", this.status, xhr.statusText, url);
        reject({
          status: this.status,
          statusText: xhr.statusText
        });
      }
    };
    xhr.onerror = function () {
      console.log("xhr.onerror", this.status, xhr.statusText, url);
      reject({
        status: this.status,
        statusText: xhr.statusText
      });
    };
  });
  
  prom.startProcess = function(param) { xhr.send(param); };
  
  return prom;
};

window.gfUtils.live2dUtils.hideProgress = function hideProgress(container) {
  $(container).find('.live2dloadingprogress').hide();
};

window.gfUtils.live2dUtils.showProgress = function showProgress(container, done, length) {
  var progress = $(container).find('.live2dloadingprogress').first();
  
  if (progress.length == 0) {
    var centeringFix = $('<span></span>');
    var live2dprogress = $('<div></div>').addClass("live2dprogress").append(centeringFix);
    var live2dprogressbar = $('<div></div>').addClass("live2dprogressbar");
    var live2dprogressbarcontainer = $('<div></div>').addClass("live2dprogressbarcontainer").append(live2dprogressbar);
    progress = $('<div></div>').addClass("live2dloadingprogress").append(live2dprogress).append(live2dprogressbarcontainer);
    progress.insertBefore($(container).find('.live2dstage'));
  }
  
  progress.show();
  
  var progressAmount = parseFloat(done / length * 100).toFixed(2);
  progress.find('.live2dprogress span').text(progressAmount+"%");
  progress.find('.live2dprogressbar').css('width', progressAmount + "%");
};

window.gfUtils.live2dUtils.convertSettingsFromUl = function(parentUl) {
  var models = [];
  
  var settings = parentUl;
  settings.children('ul').each(function() {
    var live2dsettings = $(this);
    live2dsettings.children('li').each(function() {
      var costumeSetting = $(this);
      
      var model = {};
      model.costumeId = costumeSetting.contents().get(0).nodeValue.trim();
    
      var versions = costumeSetting.children('ul');
      versions.children('li').each(function() {
        var version = $(this);
        var versionName = version.contents().get(0).nodeValue.trim();
        model[versionName] = {};
      
        var versionSettings = version.children('ul');
        versionSettings.children('li').each(function() {
          var param = $(this);
          var paramFull = param.contents().get(0).nodeValue.trim();
          var paramName = paramFull.split(":")[0];
          switch (paramName) {
            case "physics":
            case "pose":
            case "model":
              model[versionName][paramName] = param.children('a').first().attr('href');
              break;
            case "layout":
              var subSettings = param.children('ul');
              model[versionName][paramName] = {};
              subSettings.children('li').each(function() {
                var subParam = $(this);
                var subParamFull = subParam.contents().get(0).nodeValue.trim();
                var subVal = parseFloat(subParamFull.split(":")[1]);
                model[versionName][paramName][subParamFull.split(":")[0]] = subVal;
              });
              break;
            case "hit_areas":
              var subSettings = param.children('ul');
              model[versionName][paramName] = [];
              subSettings.children('li').each(function() {
                var subParam = $(this);
                var subParamFull = subParam.contents().get(0).nodeValue.trim();
                var subVal = subParamFull.split(":")[1];
                model[versionName][paramName].push({ name: subParamFull.split(":")[0], id: subVal });
              });
              break;
            case "texture": // Compatibility. Delete if all fixed
            case "textures":
              var textureSettings = param.children('ul');
              model[versionName]["textures"] = [];
              textureSettings.children('li').each(function() {
                var subParam = $(this);
                var subVal = subParam.children('a').first().attr('href')
                model[versionName]["textures"].push(subVal);
              });
              break;
            case "motions":
              var motionSettings = param.children('ul');
              model[versionName][paramName] = {};
              motionSettings.children('li').each(function() {
                var motionSet = $(this);
                var motionSetName = motionSet.contents().get(0).nodeValue.trim();
                model[versionName][paramName][motionSetName] = [];
                motionSet.children('ul').first().children('li').each(function() {
                  var motion = $(this);
                  model[versionName][paramName][motionSetName].push({ file: motion.children('a').first().attr('href') });
                });
              });
              break;
            case "name":
              model[versionName][paramName] = paramFull.split(":")[1].trim();
              break;
            default:
              console.log("Unknown param:", paramName);
          }
        });
      }); // versions.children('li').each
    
      models.push(model);
    }); // live2dsettings.children('li').each
  }); // settings.children('ul').each

  return models;
};

window.gfUtils.live2dUtils.createLive2dView = function createLive2dView(container, callback, width, height) {
  var live2dView = $(container).find('.live2dstage');
  
  var _width = width;
  if (!_width) _width = 550;
  
  var _height = height;
  if (!_height) _height = 550;
  
  if (live2dView.length < 1) {
      // Init renderer
      const l2d_tdoll_renderer = PIXI.autoDetectRenderer(_width, _height, {transparent: true});
      const l2d_tdoll_stage = new PIXI.Container();

      // Start the animation
      function animate() {
        requestAnimationFrame(animate);
        l2d_tdoll_renderer.render(l2d_tdoll_stage);
      }
      animate();

      var view = $(l2d_tdoll_renderer.view);
      view.data('live2dStage', l2d_tdoll_stage);
      view.addClass('live2dstage');
      view.data('renderer', l2d_tdoll_renderer);

      callback(view);
  } else {
    callback(live2dView.first());
  }
};

window.gfUtils.live2dUtils.loadLive2dGirl = function loadLive2dGirl(container, _tdoll, _costume, _variant, successCallback, failureCallback) {
  // Show initially
  window.gfUtils.live2dUtils.showProgress(container, 0, 1000);

  var modelLoadedHandler = function (data) {
            // Init
            var counter = 0;
            var maxItems = 1000;
            var confun = function() {
              window.gfUtils.live2dUtils.showProgress(container, counter, maxItems);
              counter++;
            };
            
            confun();
            
            json = data;
            
            var loadingJobs = new Array();
            
            if (json.hasOwnProperty('model')) {
              var job = window.gfUtils.live2dUtils.makeBase64Request(json.model);
              job.then(function(promiseData) {
                var _datatoPush = "data:text/plain;base64," + promiseData;
                json.model = _datatoPush;
                confun();
              });
              loadingJobs.push(job);
            }
            
            if (json.hasOwnProperty('physics')) {
              var job = window.gfUtils.live2dUtils.makeBase64Request(json.physics);
              job.then(function(promiseData) {
                var _datatoPush = "data:text/plain;base64," + promiseData;
                json.physics = _datatoPush;
                confun();
              });
              loadingJobs.push(job);
            }
            
            if (json.hasOwnProperty('pose')) {
              var job = window.gfUtils.live2dUtils.makeBase64Request(json.pose);
              job.then(function(promiseData) {
                var _datatoPush = "data:text/plain;base64," + promiseData;
                json.pose = _datatoPush;
                confun();
              });
              loadingJobs.push(job);
            }
            
            var idx = 0;
            for (idx=json.motions.idle.length-1; idx >= 0; idx--) {
              var job = window.gfUtils.live2dUtils.makeBase64Request(json.motions.idle[idx].file);
              job.then(function(promiseData) {
                var _datatoPush = "data:text/plain;base64," + promiseData;
                json.motions.idle.push({ "file": _datatoPush, "fade_in":0, "fade_out":0 });
                confun();
              });
              json.motions.idle.splice(idx, 1);
              loadingJobs.push(job);
            }
            
            for (idx=json.motions.tap_figure.length-1; idx >= 0 ; idx--) {
              var job = window.gfUtils.live2dUtils.makeBase64Request(json.motions.tap_figure[idx].file);
              job.then(function(promiseData) {
                var _datatoPush = "data:text/plain;base64," + promiseData;
                json.motions.tap_figure.push({ "file": _datatoPush, "fade_in":0, "fade_out":0 });
                confun();
              });
              json.motions.tap_figure.splice(idx, 1);
              loadingJobs.push(job);
            }
            
            for (idx=0; idx < json.textures.length; idx++) {
              var job = window.gfUtils.live2dUtils.makeBase64Request(json.textures[idx]);
              job.then(function(promiseData) {
                var _datatoPush = "data:image/png;base64," + promiseData;
                json.textures.push(_datatoPush);
                confun();
              });
              json.textures.splice(idx, 1);
              loadingJobs.push(job);
            }
            
            // Ajaxing
            maxItems = loadingJobs.length;
            for (idx=0; idx < loadingJobs.length; idx++) { loadingJobs[idx].startProcess(null); }
            
            // Do it
            var successHandler = function(values) { 
                var l2d_tdoll_sprite = window.gfUtils.live2dUtils.createLive2dSprite(json);
                window.gfUtils.live2dUtils.hideProgress(container);
                successCallback(l2d_tdoll_sprite);
            };
            var failureHandler = function(reason) { 
              console.log("Failed ajax", reason);
              window.gfUtils.live2dUtils.hideProgress(container);
              if (typeof failureCallback == "function") {
                failureCallback(reason);
              }
            };
            Promise.all(loadingJobs)
                   .then(successHandler)['catch'](failureHandler); // I can't call catch? really?
  };  
  
  var settings = $(container).find('.live2dsettings').first();

  var convertedSettings = window.gfUtils.live2dUtils.convertSettingsFromUl(settings);

  var i = 0;
  for (i=0; i<convertedSettings.length; i++) {
    if (convertedSettings[i].costumeId == _costume) {
      var jsonToLoad = null;
      if (_variant == "D") {
        jsonToLoad = convertedSettings[i].damaged;
      } else {
        if (convertedSettings[i].hasOwnProperty(_variant)) {
          jsonToLoad = convertedSettings[i][_variant];
        } else {
          jsonToLoad = convertedSettings[i].normal;
        }
      }
      modelLoadedHandler(jsonToLoad);
    }
  }
};